import './App.css'
import Navbar from './components/Navbar'
import {Switch, Route} from "react-router-dom";

const Home = () => {
	return (
		<>
		<Navbar />
		<h1>Home</h1>
		</>
	)
}

const Docs = () => {
	return (
		<>
		<Navbar />
		<h1>Docs</h1>
		</>
	)
}

const Features = () => {
	return (
		<>
		<Navbar />
		<h1>Features</h1>
		</>
	)
}

const Trends = () => {
	return (
		<>
		<Navbar />
		<h1>Trends</h1>
		</>
	)
}


function App() {
  return (
    <Switch>
		<Route path="/">
			<Home />
		</Route>
		<Route path="/docs">
			<Docs />
		</Route>
		<Route path="/features">
			<Features />
		</Route>
		<Route path="/trends">
			<Trends />
		</Route>
	</Switch>
  )
}

export default App
